27	Wycig gokartw	2025-05-11	Co roku kada z balli wystawia do zawodw swoje gokarty (tak, maj swoje wasnorcznie zbudowane wzki), ozdabiajc je z jajem. Balla Monte Christo uya do tego pozostaoci z kostiumu Smauga, balla Impero przywizaa swojego potnego czonka Odyna do ka na kkach, pojawi si te wzek inwalidzki. \r\n\r\nPierwsza konkurencja polegaa na zebraniu najwikszej iloci narodowoci w orszaku za danym wzkiem. Zapewnilimy naszym gospodarzom zwycistwo w tej kategorii.\r\n\r\nW nastpnej konkurencji goliardzi przypili po trzy balony do swoich wzkw. W specjalnie wyznaczonej do tego strefie trzyosobowe druyny (dwch pchajcych wzek i jeden pasaer) staray si przeku balony przeciwnikw za pomoc szaszykw.\r\nW naszej druynie jednym z pchajcych by Nobod, za pasaerem Stefano. Walczyli dzielnie, ale w kocu przegrali z wzkiem inwalidzkim.\r\n\r\nOstatni konkurencj  by wycig, poprzedzony obaleniem caej butli wina przez druyny. Przez oszustwo pasaera (Stefano) nasza druyna (Szymon Zwias i Nobod) musiaa oprcz tego wyzerowa puszk piwa, ktrego to zadania podj si Nobod. Przez to opnienie musielimy niele przyspieszy. Sklejany tam klejc gruchot nie wytrzyma i rozpad si podczas morderczego biegu posyajc pchajcych na bruk, a Stefano w bliej nieokrelonym kierunku. Mimo fiasko incydent spotka si z wiwatem ze strony goliardw na cze pchajcych.	25	26	14:00:00
28	Zwiedzanie Piazza Magiore	2025-05-11	Jeden ze studentw sztuki postawi nam wszystkim darmowe piwo i postanowi pokaza par tajemnic Bolonii.\r\n\r\n1. Iluzja optyczna fontanny Neptuna: autor chcia przyprawi Neptunowi duego czonka, jednak spotkao si to z dezaprobat kocioa. Postanowi wic utrze klerowi nosa i ustawi palec boga w taki sposb, by z perspektywy ksiy idcych (codziennie!) do bazyliki przypomina cakiem pokany maszt w erekcji\r\n\r\n2. Koniunkcja trzech wie Bolonii: trzy wiee symbolizujce kolejno wadz, ludzi i koci s ustawione w jednej linii by pokaza rwno tych trzech\r\n\r\n3. Najwiksze skarby redniowieczej Bolonii: Pod ukiem jednej z arkad znajduje si fresk przestawiajcy winorol, zboe i... konopi - Bolonia jako miasto portowe, masowo produkowaa liny. Dzi przedstawienie konopii jako obroc ludu byoby nie do pomylenia\r\n\r\n4. Konfesjona z czasw epidemii: Popularna atrakcja. 4 uki - mwic do ciany pod dowolnym ukiem, sycha Ci w kadym innym	25	26	16:00:00
